import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';
import unimelb from '../assets/img/UoM_Logo.png';
import gradient from '../assets/img/color-sharp.png';
import msp from '../assets/img/melbourne_space_program_logo.jpeg';
import misc from '../assets/img/misc_logo.jpeg';
import think_tank from '../assets/img/think_tank_logo.jpeg';
import urt from '../assets/img/urt.png';

const Experience = () => {

    const responsive = {
        superLargeDesktop: {
            breakpoint: { max: 4000, min: 3000 },
            items: 5
        },
        desktop: {
            breakpoint: { max: 3000, min: 1024 },
            items: 3
        },
        tablet: {
            breakpoint: { max: 1024, min: 464 },
            items: 2
        },
        mobile: {
            breakpoint: { max: 464, min: 0 },
            items: 1
        }
    };
    return (
        <section className = "skill" id = "skills">

            <div className="container">
                <div className="row">
                    <div className="col-12">
                        <div className="skill-bx wow zoomIn">
                            <h2>
                                Technical Skills
                            </h2>
                            <p>
                                Hi I am this. This is my skills, I do this and this. Very proficient at this.
                            </p>
                            <Carousel responsive = {responsive} infinite = {true} className = "skill-slider">
                            <div className = "item">
                                    <img src = {misc} alt = "Image" />
                                    <h5>MISC</h5>
                                </div>
                                <div className = "item">
                                    <img src = {msp} alt = "Image" />
                                    <h5>Melbourne Space Program</h5>
                                </div>
                                <div className = "item">
                                    <img src = {urt} alt = "Image" />
                                    <h5>Unimelb Rover Team</h5>
                                </div>
                                <div className = "item">
                                    <img src = {think_tank} alt = "Image" />
                                    <h5>Think Tank</h5>
                                </div>
                                <div className = "item">
                                    <img src = {unimelb} alt = "Image" />
                                    <h5>University of Melbourne</h5>
                                </div>

                            </Carousel>
                        </div>
                    </div>
                </div>
            </div>
            <img className="background-image-left" src={gradient}/>
        </section>
    )

}
export default Experience;
